import React from "react";

const LibrarySongs = ({ song }) => {
  return (
    <div className="card">
      <img src={song.cover} alt={song.name} />
      <h3>{song.name}</h3>
      <p>{song.artist}</p>
      <p>{song.type}</p>
    </div>
  );
};

export default LibrarySongs;
